// Store existing IDs in workflow static data for later use
const items = $input.all();
const existingIds = items.map(item => item.json.source_id).filter(id => id);

// Store in workflow static data so we can access it later
$getWorkflowStaticData('global').existingYouTubeIds = existingIds;

return [{ json: { existingCount: existingIds.length, existingIds } }];

// Get YouTube videos and filter to only NEW videos
const videos = $input.all();

// Get existing IDs from workflow static data
const existingIds = new Set($getWorkflowStaticData('global').existingYouTubeIds || []);

// Handle case where no videos from YouTube
if (!videos || videos.length === 0) {
  return [{
    json: {
      _noNewVideos: true,
      itemsProcessed: 0
    }
  }];
}

const timestamp = new Date().toISOString();

// Format and filter to only NEW videos
const newVideos = videos
  .map(item => {
    const video = item.json;
    const snippet = video.snippet || {};
    const contentDetails = video.contentDetails || {};
    const resourceId = snippet.resourceId || {};

    // Get video ID from multiple possible locations
    const videoId = contentDetails.videoId || resourceId.videoId || '';

    return {
      videoId,
      title: snippet.title || 'Untitled Video',
      content_type: 'youtube',
      url: videoId ? `https://www.youtube.com/watch?v=${videoId}` : '',
      source_platform: 'youtube',
      source_id: videoId,
      status: 'published',
      author: snippet.channelTitle || 'GrowthLab',
      description: (snippet.description || '').substring(0, 500),
      full_content: snippet.description || '',
      date_created: snippet.publishedAt || timestamp,
      synced_at: timestamp
    };
  })
  .filter(v => v.source_id && !existingIds.has(v.source_id)); // Only NEW videos

// If no new videos, return marker
if (newVideos.length === 0) {
  return [{
    json: {
      _noNewVideos: true,
      itemsProcessed: 0,
      existingCount: existingIds.size,
      totalFromYouTube: videos.length
    }
  }];
}

// Return each new video as separate item for processing
return newVideos.map(video => ({ json: video }));

// Fetch YouTube transcript using Android client method
// EXACT parameters from working n8n workflow tutorial

const logs = [];
logs.push('=== FETCH TRANSCRIPT (Android Method v2) ===');

let input = $input.first();
if (input && input.json) {
  input = input.json;
}

const dbId = input?.id;
const videoId = input?.source_id;

logs.push('videoId: ' + videoId);

if (!videoId) {
  return [{ json: { dbId, videoId: 'unknown', transcript: '', hasTranscript: false, error: 'No videoId', logs } }];
}

try {
  // Step 1: Get the video page to extract API key
  logs.push('Step 1: Fetching video page for API key...');

  const videoPageUrl = 'https://www.youtube.com/watch?v=' + videoId;
  const page = await this.helpers.httpRequest({
    method: 'GET',
    url: videoPageUrl,
    headers: {
      'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36',
      'Accept-Language': 'en-US,en;q=0.9'
    }
  });

  logs.push('Got page: ' + page.length + ' chars');

  // Extract INNERTUBE_API_KEY from page
  const apiKeyMatch = page.match(/"INNERTUBE_API_KEY":"([^"]+)"/);
  if (!apiKeyMatch) {
    logs.push('ERROR: Could not find API key in page');
    return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: 'Could not find YouTube API key', logs } }];
  }
  const apiKey = apiKeyMatch[1];
  logs.push('API Key: ' + apiKey);

  // Step 2: Call player endpoint as ANDROID client
  // Using EXACT parameters from the working tutorial
  logs.push('Step 2: Calling player API as Android client...');

  const playerUrl = 'https://www.youtube.com/youtubei/v1/player?key=' + apiKey;

  // Android client context - EXACT from tutorial screenshot
  const userAgent = 'com.google.android.youtube/20.10.38 (Linux; U; Android 11) gzip';

  const context = {
    client: {
      clientName: 'ANDROID',
      clientVersion: '20.10.38',
      androidSdkVersion: 30,
      userAgent: userAgent,
      hl: 'en',
      gl: 'US',
      timeZone: 'America/New_York',
      utcOffsetMinutes: -300
    }
  };

  const requestBody = {
    context: context,
    videoId: videoId
  };

  logs.push('Request context: ' + JSON.stringify(context.client));

  const playerResponse = await this.helpers.httpRequest({
    method: 'POST',
    url: playerUrl,
    headers: {
      'Content-Type': 'application/json',
      'User-Agent': userAgent
    },
    body: JSON.stringify(requestBody)
  });

  let playerData;
  if (typeof playerResponse === 'string') {
    playerData = JSON.parse(playerResponse);
  } else {
    playerData = playerResponse;
  }

  logs.push('Player response keys: ' + Object.keys(playerData).join(', '));

  // Check playability status
  const playabilityStatus = playerData?.playabilityStatus?.status;
  logs.push('Playability status: ' + playabilityStatus);

  if (playabilityStatus !== 'OK') {
    const reason = playerData?.playabilityStatus?.reason || 'unknown reason';
    logs.push('Video not playable: ' + reason);

    // If LOGIN_REQUIRED, try alternative approach
    if (playabilityStatus === 'LOGIN_REQUIRED') {
      logs.push('Trying alternative: ANDROID_EMBEDDED_PLAYER client...');

      const embeddedContext = {
        client: {
          clientName: 'ANDROID_EMBEDDED_PLAYER',
          clientVersion: '20.10.38',
          androidSdkVersion: 30,
          userAgent: userAgent,
          hl: 'en',
          gl: 'US',
          timeZone: 'America/New_York',
          utcOffsetMinutes: -300
        }
      };

      const embeddedBody = {
        context: embeddedContext,
        videoId: videoId
      };

      const embeddedResponse = await this.helpers.httpRequest({
        method: 'POST',
        url: playerUrl,
        headers: {
          'Content-Type': 'application/json',
          'User-Agent': userAgent
        },
        body: JSON.stringify(embeddedBody)
      });

      if (typeof embeddedResponse === 'string') {
        playerData = JSON.parse(embeddedResponse);
      } else {
        playerData = embeddedResponse;
      }

      logs.push('Embedded response keys: ' + Object.keys(playerData).join(', '));
      logs.push('Embedded playability: ' + playerData?.playabilityStatus?.status);
    }
  }

  // Step 3: Extract caption tracks
  logs.push('Step 3: Extracting caption tracks...');

  const captions = playerData?.captions;
  if (!captions) {
    logs.push('No captions object in response');
    logs.push('Response preview: ' + JSON.stringify(playerData).substring(0, 1500));
    return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: 'No captions in player response', logs } }];
  }

  const captionTracks = captions?.playerCaptionsTracklistRenderer?.captionTracks;
  if (!captionTracks || captionTracks.length === 0) {
    logs.push('No caption tracks found');
    logs.push('Captions structure: ' + JSON.stringify(captions).substring(0, 500));
    return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: 'No caption tracks available', logs } }];
  }

  logs.push('Found ' + captionTracks.length + ' caption tracks');

  // List available tracks
  for (const track of captionTracks) {
    const name = track.name?.simpleText || track.name?.runs?.[0]?.text || 'unnamed';
    logs.push('  Track: ' + track.languageCode + ' - ' + name + ' (kind: ' + (track.kind || 'standard') + ')');
  }

  // Step 4: Select English track
  logs.push('Step 4: Selecting caption track...');

  let selectedTrack = captionTracks.find(t => t.languageCode === 'en' && t.kind !== 'asr') ||
                      captionTracks.find(t => t.languageCode === 'en') ||
                      captionTracks.find(t => t.languageCode?.startsWith('en')) ||
                      captionTracks[0];

  const trackName = selectedTrack.name?.simpleText || selectedTrack.name?.runs?.[0]?.text || 'unnamed';
  logs.push('Selected: ' + selectedTrack.languageCode + ' - ' + trackName);

  if (!selectedTrack.baseUrl) {
    logs.push('ERROR: No baseUrl in selected track');
    logs.push('Track data: ' + JSON.stringify(selectedTrack));
    return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: 'No URL in caption track', logs } }];
  }

  // Step 5: Fetch the transcript XML
  logs.push('Step 5: Fetching transcript from baseUrl...');
  const captionUrl = selectedTrack.baseUrl;
  logs.push('URL: ' + captionUrl.substring(0, 120) + '...');

  const transcriptXml = await this.helpers.httpRequest({
    method: 'GET',
    url: captionUrl,
    headers: {
      'User-Agent': userAgent
    }
  });

  logs.push('Got transcript: ' + transcriptXml.length + ' chars');

  // Step 6: Parse XML and extract text
  logs.push('Step 6: Parsing transcript...');

  const textMatches = transcriptXml.match(/<text[^>]*>([\s\S]*?)<\/text>/g) || [];
  logs.push('Found ' + textMatches.length + ' text segments');

  if (textMatches.length === 0) {
    logs.push('No text segments found in XML');
    logs.push('XML preview: ' + transcriptXml.substring(0, 500));
    return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: 'No text in transcript XML', logs } }];
  }

  const transcriptParts = textMatches.map(match => {
    const textContent = match.replace(/<text[^>]*>/, '').replace(/<\/text>/, '');
    return textContent
      .replace(/&amp;/g, '&')
      .replace(/&lt;/g, '<')
      .replace(/&gt;/g, '>')
      .replace(/&quot;/g, '"')
      .replace(/&#39;/g, "'")
      .replace(/&nbsp;/g, ' ')
      .replace(/\n/g, ' ')
      .trim();
  }).filter(t => t);

  const transcript = transcriptParts.join(' ').replace(/\s+/g, ' ').trim();

  logs.push('SUCCESS: ' + transcript.length + ' chars from ' + transcriptParts.length + ' segments');
  logs.push('Preview: ' + transcript.substring(0, 200) + '...');
  logs.push('=== DONE ===');

  return [{ json: { dbId, videoId, transcript, hasTranscript: transcript.length > 0, segmentCount: transcriptParts.length, method: 'android-innertube', logs } }];

} catch (error) {
  logs.push('ERROR: ' + error.message);
  return [{ json: { dbId, videoId, transcript: '', hasTranscript: false, error: error.message, logs } }];
}

// Collect all results and count for sync log
// This node receives items from both paths: with transcript and without
const items = $input.all();

let synced = 0;
let withTranscript = 0;
let withoutTranscript = 0;

for (const item of items) {
  // Check if this item went through the transcript path
  if (item.json.hasTranscript === true || item.json.full_content) {
    withTranscript++;
  } else {
    withoutTranscript++;
  }
  synced++;
}

return [{
  json: {
    itemsProcessed: synced,
    itemsSynced: synced,
    withTranscript,
    withoutTranscript,
    status: 'completed'
  }
}];
